import { Button, Flex, HStack, Text } from "@chakra-ui/react";
import React from "react";

const Index = () => {
  return (
    <HStack mt="100" w="100%">
      <Flex w="100%" justifyContent="center" alignItems="center" bg="primary">
        <Flex
          justifyContent="space-between"
          alignItems="center"
          w="100%"
          maxW="container.lg"
        >
          <Text>Wan't to know more about me?</Text>
          <Button>Reach me</Button>
        </Flex>
      </Flex>
    </HStack>
  );
};

export default Index;
